import React from 'react'

const Collection = () => {
  return (
    <div className='collection' >
        <div className='collection__card'>
          <div className='collection__card_img'>
            <img />
          </div>
          <div className='collection-card_title' ></div>

        </div>

    </div>
  )
}

export default Collection;
